수고하십시오. ㅡ ㅡ ;;

면이 너무 불어서 왔고.. 자장면이 짜워요..;; (짜장을 너무 많이 넣은듯..) 그리고 면이 다 끊겨 있는게.. 꼭 남은 자장면 다 모아놓은듯해서 찝찝함이...ㅠㅠ 
탕수육은 덩어리가 너무 크고.....ㅡㅡ
두번 시켜 먹을곳은 아닌거 같음...;;

리뷰 좋길래 시켯다가 짜장면이 국물도 완전 쫄고
시간도 1시간을 기다리고 짜증낫습니다;;
면에서 밀가루 맛 심하네요;;;
그나마 짬뽕국물만 얼큰하니 좋아서 별2개 드립니다

랩을뜯고 한젓가락 뜨자마자 머리카락이나옴...;;
단무지그릇에있는 양파는 거뭇거뭇하고(뭐가묻은듯..)
짬뽕맛도 다른곳에 비해 별로였다..추천해주고싶지않음

찹쌀 탕슉은.. 돈까스처럼 잘라져서 나오네요
일반 탕슉이 더 나을거 같아요;
네모난 용기에 담겨져서 뭔가 양도 적어보이고
특히 짬뽕은 국물이 너무 적어서;;
짬뽕 곱배기 시켰는데;;면만 한그릇은 덜어내고 먹었네요;
국물은 맛있었는데 면이 좀 불어서 맛이 덜했어요
탕슉도 소스 재료들에 연근이나 양상추가 신선하게 들어가있어서 좋긴한데...소스에 안어울리는 듯한^^;

